import React, { Component } from "react";

import NavigationBar from '../medium/navbar';
import KacangProduct from '../medium/productkacang';
import NavigationBottom from '../medium/navigationbottom';

class ProductKacang extends Component {
  render() {
     return (
     <div>
       <NavigationBar/>
       <KacangProduct/>
       <NavigationBottom/>
     </div>
     );
  }
}

export default ProductKacang;
